import React from "react";
import { Button, Container, Dropdown, Image, Menu } from "semantic-ui-react";

export default function LoginScreen() {
  return (
    <div>
      <Menu inverted fixed="top" size="massive">
        <Container>
          <Image src="images/naxus12.PNG" size="small" />
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          <Menu.Item name="messages" />
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          
          <Menu.Menu position="right" >
          <Menu.Item backgroundColor ="red">
            <Dropdown item text="Hesabım" >
              <Dropdown.Menu >
                <Dropdown.Item >
                  <Button size="tiny">Giriş Yap</Button>
                </Dropdown.Item>
                <Dropdown.Item>
                  <Button size="tiny">Kayıt ol</Button>
                </Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
            </Menu.Item>
          </Menu.Menu>
          
        </Container>
      </Menu>
    </div>

    // <div style={divstyle}>
    //   <Menu inverted fixed="top">
